script: |
  super -f text -I q940.spq | sort > q940.out

inputs:
  - name: q940.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col0 BETWEEN - col1 AND col1 + + col2 + + + CAST ( + + 4 AS INTEGER );
  - name: tab0

outputs:
  - name: q940.out
    data: |
      87	21	10
      97	1	99
